import { useSelector } from "react-redux";

export const ActivitiesPage = () => {

    const state = useSelector(state => state);

    return (
        <>
            <ul>
                {state.user.map(activity => {
                    return <li>{activity.name}</li>
                })}
            </ul>
        </>
    )
}
